import Cards from '../Cards/Cards';
import Investment from '../Investment/Investment';
import RealEstate from '../RealEstate/RealEstate';
import Services from '../Services/Services';
const Home = () => {
  return (
    <div>
      <RealEstate />
      <Cards />
      <Investment />
      <Services />
    </div>
  );
};
export default Home;
